import React from "react";

const Privacy = () => {
  return (
    <>
      <div className="privacy-main">
        <h3>
          **Privacy Policy for CourseClipper Platform: Your Trusted Course
          Review Website**
        </h3>
      </div>
    </>
  );
};

export default Privacy;
